import Note from './Note';


const NoteList = () => {
    return <div className="note-list">
        <Note/>
        <Note/>
        <Note/>
        <Note/>
    </div>
}

const RamdomColor = () => {
    const colors_block = [
      '#93B5C6',
      '#C9CCD5',
      '#E4D8DC',
      '#FFE3E3'
    ];
    const ramdomColor = colors_block[Math.floor(Math.random() * colors_block.length)]
    }
export default NoteList;
